\begin{center}
$X$ \textbf{wegzusammenh\xc3\xa4ngend:}
\begin{gather*}
\forall x,y \in X: \exists \gamma: [0,1] \to X: \\ 
\gamma(0)=x, \gamma(1)=y
\end{gather*}
\emph{Je zwei Punkte k\xc3\xb6nnen durch \\ einen Weg verbunden werden}
\end{center}

\begin{center}
\textbf{$X$ homotop zu $Y$ ($X \simeq Y$):}
\begin{gather*}
\exists f:X \to Y, g:Y \to X: \\
g\circ f \simeq \id_X, f\circ g \simeq \id_Y
\end{gather*}
\end{center}

\begin{center}
$X$ \textbf{zusammenh\xc3\xa4ngend:}
\begin{gather*}
\forall U,V \subseteq X \text{ offen, nicht-leer}: \\
U \cup V = X \Rightarrow U \cap V \neq \emptyset
\end{gather*}
\emph{$X$ kann nicht in zwei diskunkte \\ offene Mengen zerteilt werden}
\end{center}

\begin{center}
$X$ \textbf{lokal einfach zusammenh\xc3\xa4ngend:}
\begin{gather*}
\forall x \in X, U\subseteq X \text{ Umg. v. } x: \\ 
\exists V \subseteq U \text{ Umg. v. } x: V \text{ einf. zsh.}
\end{gather*}
\emph{Jede Umg. enth\xc3\xa4lt einf. zsh. Umg.}
\end{center}

\begin{center}
$X$ \textbf{lokal wegzusammenh\xc3\xa4ngend:}
\begin{gather*}
\forall x \in X, U\subseteq X \text{ Umg. v. } x: \\ 
\exists V \subseteq U \text{ Umg. v. } x: V \text{ wegzsh.}
\end{gather*}
\emph{Jede Umg. enth\xc3\xa4lt wegzsh. Umg.}
\end{center}

\begin{center}
$X$ \textbf{lokal zusammenh\xc3\xa4ngend:}
\begin{gather*}
\forall x \in X, U\subseteq X \text{ Umg. v. } x: \\ 
\exists V \subseteq U \text{ Umg. v. } x: V \text{ zsh.}
\end{gather*}
\emph{Jede Umg. enth\xc3\xa4lt zsh. Umg.}
\end{center}

\begin{center}
$X$ \textbf{schwach lokal wegzusammenh\xc3\xa4ngend:}
\begin{gather*}
\forall x \in X, U\subseteq X \text{ Umg. v. } x: \exists V \subseteq X \text{ Umg. v. } x:\\ 
\forall y \in V: \exists x \leadsto y \text{ Weg in } U
\end{gather*}
\end{center}

\begin{center}
$X$ \textbf{halb-lokal einfach zusammenh\xc3\xa4ngend:}
\begin{gather*}
\forall x \in X: \exists U\subseteq X \text{ Umg. v. } x: \\ 
\pi_1(U,x) \hookrightarrow \pi_1(X,x) \text{ trivial}
\end{gather*}
\emph{Jeder Pkt. besitzt eine Umg., die nur \\global triviale Schleifen enth\xc3\xa4lt}
\end{center}
